package main

import (
	"fmt"
	"math/rand"
	"sort"
	"sync"
)

func simpleSearch(l []int, step int, wg *sync.WaitGroup, medians []float64) {
	defer wg.Done()

	ln := len(l)
	sort.Ints(l)

	m := ln / 2
	if ln%2 == 0 {
		medians[step] = float64(l[m-1]+l[m]) / 2
	} else {
		medians[step] = float64(l[m])
	}
}

func searchMedian(l []int, k int) int {
	if len(l) == 1 {
		return l[0]
	}

	ind := rand.Intn(len(l) - 1)
	boundElement := l[ind]
	lows, highs, cores := make([]int, 0), make([]int, 0), make([]int, 0)

	for _, v := range l {
		switch {
		case v < boundElement:
			lows = append(lows, v)
		case v > boundElement:
			highs = append(highs, v)
		default:
			cores = append(cores, v)
		}
	}

	switch {
	case k < len(lows):
		return searchMedian(lows, k)
	case k < len(lows)+len(cores):
		return cores[0]
	}

	return searchMedian(highs, k-len(lows)-len(cores))
}

func recursiveSearch(l []int, step int, wg *sync.WaitGroup, medians []float64) {
	defer wg.Done()
	ln := len(l)

	if ln%2 == 0 {
		medians[step] = float64(searchMedian(l, ln/2-1)+searchMedian(l, ln/2)) / 2
	} else {
		medians[step] = float64(searchMedian(l, ln/2))
	}
}

func MedianSlidingWindow(nums []int, k int) []float64 {
	wg := &sync.WaitGroup{}

	totalMedians := len(nums) - k
	medians, search := make([]float64, totalMedians+1), simpleSearch

	if k > 5 {
		search = recursiveSearch
	}

	for step := 0; step <= totalMedians; step++ {
		chunk := make([]int, k)
		copy(chunk, nums[step:step+k])

		wg.Add(1)
		go search(chunk, step, wg, medians)
	}

	wg.Wait()

	return medians
}

